import React,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import AppNavbar from './components/navbar';
import './App.css';
import  ShoppingList from './components/ShoppingList'

class App extends Component {
  render(){
    return (
    <div className="App">
    <AppNavbar/> 
    <ShoppingList/>
    </div>
  );
}
}

export default App;
